import Link from 'next/link';
import About from './about';
import Contact from './contact';
import Projects from './projects';

const Navbar = () => (
    <div>
        <nav>
            <a href="/">Home</a>
            <a href="./About">{About}</a>
            <a href="./Projects">{Projects}</a> 
            <a href="./contact">{Contact}</a> 
        </nav>
    </div>
)
export default Navbar;
